  \"Self Deployable Ultra-Lightweight Modular Unit for Habitat Structural Applications
  Project\",\n\t\"tracking_summary\": {\n\t\t\"total\": 4,\n\t\t\"recent\": 1\n\t},\n\t\"groups\":
  [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\": \"2015-05-06T22:03:36.892142\",\n\t\"name\":
  \"self-deployable-ultra-lightweight-modular-unit-for-habitat-structural-applications-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Space deployable and rigidizable structures
  which are ultra-lightweight, and have high rigidity, space durability, and high
  impact resistance are desirable to improve the reliability and affordability of
  space structures. Some of the components currently in use such as shelters or transhabs
  use double-wall thick films with high internal pressure.  All these hollow components
  are vulnerable in space because of the debris and meteorites that can strike them.
  \ They will lose their functions if hit and damaged by foreign objects. Besides,
  these deployable structures in space typically rely upon electro-mechanical mechanisms
  and mechanically expandable booms to deploy structures and maintain them in space
  for use, which occupy over 90&#37; of the total mass budget in many cases. In this
  Phase I project, we propose to develop self-deployable, low-density microcellular
  foamed sandwiches from shape memory polymers or CHEM as structural components of
  space habitats.   Such a structural module can be compacted into a very small volume
  to facilitate launching.   The deployment energy is the heat from the sun.  This
  concept greatly simplifies the entire operation, reduction in weight and cost, and
  improves reliability.  They also feature great impact resistant.  Foams processed
  by the conventional chemical-blowing agent have toxicity problems. Our microcellular
  CHEM foamed sandwiches do not involve any toxicity and will have higher mechanical
  properties than those processed by the conventional techniques. \",\n\t\"license_title\":
